84	Opencircles	SELF	Hey Victor.\nThanks for joining Opencircles. To get a loan you first have to join a circle or create one. \n1. To join a circle, just select any circle that have been recommended to you and start borrowing. If the amount borrowed is greater than your deposit but equal to your loan limit, then you can request any of the circle members to act as a guarantor to your loan.\n2. To create a circle, click on the create circle button on your home page. Enter amount not less than Ksh 50 to be the initial deposit for anyone wanting to join the circle. Enter the interest rates that your circle will be issuing  loans at and invite not less than 5 friends, family or even colleagues to join your circle.\nRemember, any loans borrowed and repaid within a circle then the interest earned is shared among the circle members and a guarantor to a loan earn a much greater share of the interest earned.\nFrom your wallet, you can pay for goods and services, transfer money to a bank account or an m-pesa number. You can also transfer funds from your opencircles wallet to another opencircles wallet all for free. For further assistance, fell free to chat with us.	2017-11-23 12:46:17.881969+03	137	t	\N
